//  Vote

// 
// SPDX-License-Identifier: GPL-3.0

// 
// pragma solidity = 0.8.7;

// 
pragma solidity >=0.8.0 <0.9.0;

//  contract 
contract Vote {
    // 

    // Event Vote  onVote 
    //  emit 
    event onVote(address indexed voter, uint256 target);

    mapping(address => bool) public voted; // mapping 
    uint256 endTime; // 
    address payable public owner; // 

    struct Person {
        string name;
        uint256 votes;
        address payable ads;
    }

    // 
    Person[] public list;

    // uint256 public DengShen; // 1
    // uint256 public LiJilang; // 2
    // uint256 public QiuYuhang; // 3
    // uint256 public RaoWenbing; // 4
    // uint256 public WangXin; // 5
    // uint256 public XuWang; // 6
    // uint256 public YangLidong; // 7
    // uint256 public ZhongDakang; // 8
    // uint256 public ZhouHuiyu; // 9
    // address payable DengShen

    //  0  false bool mapping
    // 
    constructor(uint256 _endTime) {
        endTime = _endTime;
        owner = payable(msg.sender);

        list.push(
            Person({
                name: "DengShen",
                votes: 0,
                ads: payable(0xD96DE875d586743CE457E8Ef72145Ae75715F7E1)
            })
        );
        list.push(
            Person({
                name: "LiJilang",
                votes: 0,
                ads: payable(0x303fC2FC594Cf19014Da9831646581CDFc7ECa2E)
            })
        );
        list.push(
            Person({
                name: "QiuYuhang",
                votes: 0,
                ads: payable(0xbe188Cb3730d91Bbf2272e0B827aCF6fFdB4D074)
            })
        );
        list.push(
            Person({
                name: "RaoWenbing",
                votes: 0,
                ads: payable(0xe8d3Ceab4e5E0D33361DA6c7355835417a9B3bbe)
            })
        );
        list.push(
            Person({
                name: "WangXin",
                votes: 0,
                ads: payable(0x25309087503C0C7a4f2e9b1A04875747d61340EC)
            })
        );
        list.push(
            Person({
                name: "XuWang",
                votes: 0,
                ads: payable(0x535186c86B22B423D150530EbD57E48D4297a9Cc)
            })
        );
        list.push(
            Person({
                name: "YangLidong",
                votes: 0,
                ads: payable(0x6143CcC61F582b38626AaDAe93D1F119c66b2a70)
            })
        );
        list.push(
            Person({
                name: "ZhongDakang",
                votes: 0,
                ads: payable(0x8Fb155803f695DBE7B53b94BC1bb6db5D338d60b)
            })
        );
        list.push(
            Person({
                name: "ZhouHuiyu",
                votes: 0,
                ads: payable(0x5b9edA1F23501D891B299919dee69Ce00004cF12)
            })
        );
    }

    // 
    //  view 
    function vote(uint256 target) public payable {
        require(block.timestamp < endTime, "-1"); // 
        require(msg.value >= 100000000000000000, "-2"); //  0.1 eth

        // mappingkey-value
        voted[msg.sender] = true;
        list[target].votes++;

        //  vote()  Voted 
        emit onVote(msg.sender, target);
    }

    function setEndTime(uint256 time) public {
        require(msg.sender == owner, "-3"); // 
        endTime = time;
    }

    function endVote() public {
        require(msg.sender == owner, "-3"); // 

        uint256 max = 0;
        uint256 winnerIndex = 0;

        for (uint256 i = 0; i < list.length; i++) {
            if (list[i].votes > max) {
                max = list[i].votes;
                winnerIndex = i;
            }
        }

        list[winnerIndex].ads.transfer(address(this).balance);
    }

    //  view 
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    receive() external payable {}

    // 
    fallback() external payable {}
}
